Access your travel itineraries and collaborate with fellow travelers & friends on your trips

Highlights:
Trip Itineraries: Access your trip details from your travel provider, including curated travel & destination information. Add bookings, photos and notes to your trip; 
Collaborate: Invite friends and family to recommend places for your upcoming trip;
Group Messaging: Use the real-time chat feature to communicate with fellow travelers and your travel provider; 
Offline Accessibility: Access all of your trip details offline. The app will automatically synchronize any changes the next time your mobile device is connected to wifi.
